create table users
(
    userTag         VARCHAR(255),
    userId          VARCHAR(255)
        primary key,
    balance         INTEGER      default 0,
    xp              INTEGER      default 0 not null,
    level           INTEGER      default 0,
    lastMessageDate VARCHAR(255) default 0,
    isBanned        INTEGER      default 0,
    dailyTaken      VARCHAR(255),
    dailyStreak     INTEGER      default 0
);

